import React from 'react';
import image from './SeeHow.png';
import './App.css';

const LandingPage = () =>
  <div>
    <img src={image} class="Center" height="450" width="600" alt="SeeHow Logo"/>
    <h1>Landing Page</h1>
  </div>

export default LandingPage;
